  &lt;CreditScoreFactor bureauCode="34" xmlns="com/truelink/ds/sch/report/truelink"&gt;&#xD;
    &lt;Factor abbreviation="" description="" symbol="34" rank="100000" /&gt;&#xD;
    &lt;FactorText&gt;explain: Bankcard accounts include credit cards and charge cards from a bank and are frequently revolving accounts. Revolving accounts allow you to carry a balance and your monthly payment will vary, based on the amount of your balance. The total combined amount you owe on all of your bankcards and revolving accounts is high, a sign of increased risk. People who carry balances on multiple bankcards or other revolving accounts have reduced available credit to use if needed, creating a greater chance of becoming overextended.&lt;/FactorText&gt;&#xD;
    &lt;FactorText&gt;factor: Total of all balances on bankcard or revolving accounts is too high&lt;/FactorText&gt;&#xD;
    &lt;FactorText&gt;cando: Pay down the balances on your accounts. Ideally, the balance on any revolving account should be 30% or less of the total credit limit on that account.&lt;/FactorText&gt;&#xD;
  &lt;/CreditScoreFactor&gt;&#xD;
  &lt;CreditScoreFactor bureauCode="65" xmlns="com/truelink/ds/sch/report/truelink"&gt;&#xD;
    &lt;Factor abbreviation="" description="" symbol="65" rank="100000" /&gt;&#xD;
    &lt;FactorText&gt;explain: The VantageScore credit score model relies on information in your credit files at the three national credit reporting companies (Equifax, Experian and TransUnion) to generate your score. Your credit file does not contain enough credit behavior information about your first mortgage accounts. A mix of different types of open and active credit accounts, including first mortgage loans, can have a positive impact on your credit score.&lt;/FactorText&gt;&#xD;
    &lt;FactorText&gt;factor: Lack of sufficient relevant first mortgage account information&lt;/FactorText&gt;&#xD;
    &lt;FactorText&gt;cando: Maintaining open and active credit accounts in good standing can help improve your credit score.&lt;/FactorText&gt;&#xD;
  &lt;/CreditScoreFactor&gt;&#xD;
  &lt;CreditScoreFactor bureauCode="44" xmlns="com/truelink/ds/sch/report/truelink"&gt;&#xD;
    &lt;Factor abbreviation="" description="" symbol="44" rank="100000" /&gt;&#xD;
