    &lt;FactorText&gt;factor: Too many bankcard or revolving accounts with delinquent or derogatory status&lt;/FactorText&gt;&#xD;
    &lt;FactorText&gt;cando: Paying bills on time every month is important to maintaining a good credit score. If you remain behind with any payments, bring them current as soon as possible, and then make future payments on time. Over time this will have a positive impact on your score.&lt;/FactorText&gt;&#xD;
